import Header from "./components/Header";
import Page from "./components/PageSuccess";
import { Router, Route } from "react-router-dom";
const App = () => {
  return (
   <Router>
     <Route path='/'><Header /></Route>
      <Route path='success'><Page /></Route>
      
       
      </Router>
  );
};
export default App;
